import React from 'react'

function Header() {
	return (
		<header style={headerStyle}>
			<h1>Unbranded Market </h1>
		</header>
		)
}

const headerStyle = {
	background: 'navy',
	color: 'white',
	textAlign: 'center',
	padding: '5px'
}




export default Header
